script: |
  super -f text -I q10341.spq | sort > q10341.out

inputs:
  - name: q10341.spq
    data: |
      SELECT + col0 + - col0 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT ( NOT - col0 NOT BETWEEN + col1 AND - col1 / col0 / 70 );
  - name: tab0

outputs:
  - name: q10341.out
    data: |
      0
      0
      0
